import React from "react";
import { Page } from "../Page";
import "./"


function Home() {
  return (
    <Page title="Home">
      <section class='hero'>

        <div class='hero-content'>
          <h2 class='hero-content__title'>Book Your Seat</h2>

        </div>
        <div class='hero-box-container'>
          <a href='' class='hero-box'>
            <span class='hero-box__circle hero-box__circle--blue'></span>
            <h2 class='hero-box__title'>Sell your device</h2>
            <p class='hero-box__body'>Get instant quote and ship device for free</p>
          </a>
        <a href='' class='hero-box'>
          <span class='hero-box__circle hero-box__circle--green'></span>
          <h2 class='hero-box__title'>Repair</h2>
          <p class='hero-box__body'>Give a second chance to your device</p>
      </a>
      <a href='' class='hero-box'>
        <span class='hero-box__circle hero-box__circle--orange'></span>
        <h2 class='hero-box__title'>Exchange</h2>
        <p class='hero-box__body'>Refurbished and lightly used device marketplace</p>
    </a>
 </div >
</section >
    </Page >
  );
}

export default Home;
